import React, { Component } from 'react';

class MainMenu extends Component {
    render() {
        return (
            <div>
                <ul class="menu-main">
                    <li><a href="" class="current">Work</a></li>
                    <li><a href="">About</a></li>
                    <li><a href="">Blog</a></li>
                    <li><a href="">Contact</a></li>
                </ul>
            </div>
        )
    }
}

export default MainMenu;
